const Header = () => {
  return (
    <header>
      <h1>Venkata Sri Saketh Perapragada</h1>
      <p>
        <a href="mailto:srisaketh111@gmail.com">srisaketh111@gmail.com</a> |{' '}
        +91 93983 04407 |{' '}
        <a href="https://linkedin.com/in/sri-saketh-35767224a" target="_blank" rel="noopener noreferrer">
          LinkedIn
        </a>
      </p>
      <nav>
        <a href="#about">About</a>
        <a href="#projects">Projects</a>
        <a href="#skills">Skills</a>
        <a href="#education">Education</a>
        <a href="#certifications">Certifications</a>
        <a href="#contact">Contact</a>
      </nav>
    </header>
  );
};

export default Header;
